"use strict";(globalThis.webpackChunkt_ruby_docs=globalThis.webpackChunkt_ruby_docs||[]).push([[9282],{1452:n=>{n.exports=JSON.parse('{"archive":{"blogPosts":[{"id":"introducing-t-ruby","metadata":{"permalink":"/ko/news/introducing-t-ruby","editUrl":"https://github.com/type-ruby/t-ruby.github.io/tree/main/news/2025-12-24-introducing-t-ruby.md","source":"@site/i18n/ko/docusaurus-plugin-content-blog-news/2025-12-24-introducing-t-ruby.md","title":"T-Ruby \uc18c\uac1c","description":"Ruby\ub97c \uc704\ud55c TypeScript \uc2a4\ud0c0\uc77c \uc815\uc801 \ud0c0\uc785 \uc2dc\uc2a4\ud15c, T-Ruby\ub97c \uc18c\uac1c\ud569\ub2c8\ub2e4.","date":"2025-12-24T00:00:00.000Z","tags":[{"inline":true,"label":"announcement","permalink":"/ko/news/tags/announcement"}],"hasTruncateMarker":false,"authors":[{"name":"Yonghyun Kim","url":"https://github.com/yhk1038","imageURL":"https://github.com/yhk1038.png","key":"yhk1038","page":null}],"frontMatter":{"slug":"introducing-t-ruby","title":"T-Ruby \uc18c\uac1c","authors":["yhk1038"],"tags":["announcement"]},"unlisted":false,"nextItem":{"title":"\ud0c0\uc785 \ucd94\ub860: \uc801\uac8c \uc4f0\uace0, \ub354 \ub9ce\uc774 \ud0c0\uc774\ud551\ud558\uc138\uc694","permalink":"/ko/news/type-inference-released"}},"content":"Ruby\ub97c \uc704\ud55c TypeScript \uc2a4\ud0c0\uc77c \uc815\uc801 \ud0c0\uc785 \uc2dc\uc2a4\ud15c, T-Ruby\ub97c \uc18c\uac1c\ud569\ub2c8\ub2e4.\\n\\nT-Ruby\ub294 TypeScript \uac1c\ubc1c\uc790\uc5d0\uac8c \uc775\uc219\ud55c \uac1c\ubc1c \uacbd\ud5d8\uc744 Ruby \uac1c\ubc1c\uc790\uc5d0\uac8c \uc81c\uacf5\ud558\uc5ec, \ucf54\ub4dc\uc5d0 \uc9c1\uc811 \ud0c0\uc785 \uc5b4\ub178\ud14c\uc774\uc158\uc744 \ucd94\uac00\ud558\uace0 \ub7f0\ud0c0\uc784 \uc804\uc5d0 \ud0c0\uc785 \uc624\ub958\ub97c \uac10\uc9c0\ud560 \uc218 \uc788\uac8c \ud569\ub2c8\ub2e4.\\n\\n## \uc8fc\uc694 \uae30\ub2a5\\n\\n- **TypeScript \uc2a4\ud0c0\uc77c \ubb38\ubc95**: TypeScript \uac1c\ubc1c\uc790\uc5d0\uac8c \uc775\uc219\ud55c \ud0c0\uc785 \uc5b4\ub178\ud14c\uc774\uc158 \ubb38\ubc95\\n- **\uc810\uc9c4\uc801 \ud0c0\uc774\ud551**: \uae30\uc874 Ruby \ucf54\ub4dc\ubca0\uc774\uc2a4\uc5d0 \uc810\uc9c4\uc801\uc73c\ub85c \ud0c0\uc785 \ucd94\uac00 \uac00\ub2a5\\n- **RBS \uc0dd\uc131**: `.rbs` \uc2dc\uadf8\ub2c8\ucc98 \ud30c\uc77c \uc790\ub3d9 \uc0dd\uc131\\n- **\uc81c\ub85c \ub7f0\ud0c0\uc784 \uc624\ubc84\ud5e4\ub4dc**: \ucef4\ud30c\uc77c \uc2dc \ud0c0\uc785\uc774 \uc81c\uac70\ub428\\n\\n## \uc2dc\uc791\ud558\uae30\\n\\nT-Ruby\ub97c \uc124\uce58\ud558\uace0 Ruby \ucf54\ub4dc\uc5d0 \ud0c0\uc785\uc744 \ucd94\uac00\ud574\ubcf4\uc138\uc694:\\n\\n```bash\\ngem install t-ruby\\n```\\n\\n\uccab \ubc88\uc9f8 `.trb` \ud30c\uc77c\uc744 \uc791\uc131\ud569\ub2c8\ub2e4:\\n\\n```ruby\\ndef greet(name: String): String\\n  \\"Hello, #{name}!\\"\\nend\\n```\\n\\nRuby\ub85c \ucef4\ud30c\uc77c:\\n\\n```bash\\ntrc greet.trb\\n```\\n\\n\ub354 \uc790\uc138\ud55c \ub0b4\uc6a9\uc740 [\ubb38\uc11c](/docs/introduction/what-is-t-ruby)\ub97c \ud655\uc778\ud558\uc138\uc694!"},{"id":"type-inference-released","metadata":{"permalink":"/ko/news/type-inference-released","editUrl":"https://github.com/type-ruby/t-ruby.github.io/tree/main/news/2025-12-24-type-inference.md","source":"@site/i18n/ko/docusaurus-plugin-content-blog-news/2025-12-24-type-inference.md","title":"\ud0c0\uc785 \ucd94\ub860: \uc801\uac8c \uc4f0\uace0, \ub354 \ub9ce\uc774 \ud0c0\uc774\ud551\ud558\uc138\uc694","description":"T-Ruby\uac00 \uc774\uc81c \ucf54\ub4dc\uc5d0\uc11c \ubc18\ud658 \ud0c0\uc785\uc744 \uc790\ub3d9\uc73c\ub85c \ucd94\ub860\ud569\ub2c8\ub2e4. \uba85\ubc31\ud55c \ud0c0\uc785\uc5d0 \ub300\ud574 \ub354 \uc774\uc0c1 \uba85\uc2dc\uc801 \uc5b4\ub178\ud14c\uc774\uc158\uc774 \ud544\uc694 \uc5c6\uc2b5\ub2c8\ub2e4!","date":"2025-12-24T00:00:00.000Z","tags":[{"inline":true,"label":"release","permalink":"/ko/news/tags/release"},{"inline":true,"label":"feature","permalink":"/ko/news/tags/feature"}],"hasTruncateMarker":false,"authors":[{"name":"Yonghyun Kim","url":"https://github.com/yhk1038","imageURL":"https://github.com/yhk1038.png","key":"yhk1038","page":null}],"frontMatter":{"slug":"type-inference-released","title":"\ud0c0\uc785 \ucd94\ub860: \uc801\uac8c \uc4f0\uace0, \ub354 \ub9ce\uc774 \ud0c0\uc774\ud551\ud558\uc138\uc694","authors":["yhk1038"],"tags":["release","feature"]},"unlisted":false,"prevItem":{"title":"T-Ruby \uc18c\uac1c","permalink":"/ko/news/introducing-t-ruby"}},"content":"T-Ruby\uac00 \uc774\uc81c \ucf54\ub4dc\uc5d0\uc11c \ubc18\ud658 \ud0c0\uc785\uc744 \uc790\ub3d9\uc73c\ub85c \ucd94\ub860\ud569\ub2c8\ub2e4. \uba85\ubc31\ud55c \ud0c0\uc785\uc5d0 \ub300\ud574 \ub354 \uc774\uc0c1 \uba85\uc2dc\uc801 \uc5b4\ub178\ud14c\uc774\uc158\uc774 \ud544\uc694 \uc5c6\uc2b5\ub2c8\ub2e4!\\n\\n## \uc0c8\ub85c\uc6b4 \uae30\ub2a5\\n\\n\uc774\uc804\uc5d0\ub294 \uc774\ub807\uac8c \uc791\uc131\ud574\uc57c \ud588\uc2b5\ub2c8\ub2e4:\\n\\n```ruby\\ndef greet(name: String): String\\n  \\"Hello, #{name}!\\"\\nend\\n```\\n\\n\uc774\uc81c \ubc18\ud658 \ud0c0\uc785\uc740 \uc120\ud0dd\uc0ac\ud56d\uc785\ub2c8\ub2e4:\\n\\n```ruby\\ndef greet(name: String)\\n  \\"Hello, #{name}!\\"\\nend\\n```\\n\\nT-Ruby\uac00 `greet`\uc774 `String`\uc744 \ubc18\ud658\ud55c\ub2e4\uace0 \ucd94\ub860\ud558\uace0 \uc62c\ubc14\ub978 RBS\ub97c \uc0dd\uc131\ud569\ub2c8\ub2e4:\\n\\n```rbs\\ndef greet: (name: String) -> String\\n```\\n\\n## \ub3d9\uc791 \uc6d0\ub9ac\\n\\n\uc0c8\ub85c\uc6b4 \ud0c0\uc785 \ucd94\ub860 \uc5d4\uc9c4\uc740 \uba54\uc11c\ub4dc \ubcf8\ubb38\uc744 \ubd84\uc11d\ud558\uc5ec \ubc18\ud658 \ud0c0\uc785\uc744 \uacb0\uc815\ud569\ub2c8\ub2e4:\\n\\n- **\ub9ac\ud130\ub7f4 \ucd94\ub860**: `\\"hello\\"` \u2192 `String`, `42` \u2192 `Integer`\\n- **\uba54\uc11c\ub4dc \ud638\ucd9c \ucd94\uc801**: `str.upcase` \u2192 `String`\\n- **\uc554\ubb35\uc801 \ubc18\ud658**: Ruby\uc758 \ub9c8\uc9c0\ub9c9 \ud45c\ud604\uc2dd\uc774 \ubc18\ud658 \ud0c0\uc785\uc774 \ub428\\n- **\uc870\uac74\ubb38 \ucc98\ub9ac**: `if`/`else` \ubd84\uae30\uc5d0\uc11c \uc720\ub2c8\uc628 \ud0c0\uc785\\n\\n## \uc608\uc81c\\n\\n### \uac04\ub2e8\ud55c \uba54\uc11c\ub4dc\\n\\n```ruby\\nclass Calculator\\n  def double(n: Integer)\\n    n * 2\\n  end\\n\\n  def is_positive?(n: Integer)\\n    n > 0\\n  end\\nend\\n```\\n\\n\uc0dd\uc131\ub41c RBS:\\n\\n```rbs\\nclass Calculator\\n  def double: (n: Integer) -> Integer\\n  def is_positive?: (n: Integer) -> bool\\nend\\n```\\n\\n### \uc778\uc2a4\ud134\uc2a4 \ubcc0\uc218\\n\\n```ruby\\nclass User\\n  def initialize(name: String)\\n    @name = name\\n  end\\n\\n  def greeting\\n    \\"Hello, #{@name}!\\"\\n  end\\nend\\n```\\n\\n\uc0dd\uc131\ub41c RBS:\\n\\n```rbs\\nclass User\\n  @name: String\\n\\n  def initialize: (name: String) -> void\\n  def greeting: () -> String\\nend\\n```\\n\\n## \uae30\uc220\uc801 \uc138\ubd80\uc0ac\ud56d\\n\\n\ucd94\ub860 \uc2dc\uc2a4\ud15c\uc740 TypeScript\uc758 \uc811\uadfc \ubc29\uc2dd\uc5d0\uc11c \uc601\uac10\uc744 \ubc1b\uc558\uc2b5\ub2c8\ub2e4:\\n\\n- **BodyParser**: T-Ruby \uba54\uc11c\ub4dc \ubcf8\ubb38\uc744 IR \ub178\ub4dc\ub85c \ud30c\uc2f1\\n- **TypeEnv**: \ubcc0\uc218 \ud0c0\uc785 \ucd94\uc801\uc744 \uc704\ud55c \uc2a4\ucf54\ud504 \uccb4\uc778 \uad00\ub9ac\\n- **ASTTypeInferrer**: \uc9c0\uc5f0 \ud3c9\uac00\uc640 \uce90\uc2f1\uc73c\ub85c IR \uc21c\ud68c\\n\\n\uad6c\ud604\uc5d0 \ub300\ud55c \uc2ec\uce35 \ubd84\uc11d\uc740 [\uae30\uc220 \ube14\ub85c\uadf8 \ud3ec\uc2a4\ud2b8](/blog/typescript-style-type-inference)\ub97c \ud655\uc778\ud558\uc138\uc694.\\n\\n## \uc9c0\uae08 \uc0ac\uc6a9\ud574\ubcf4\uc138\uc694\\n\\n\ucd5c\uc2e0 T-Ruby\ub85c \uc5c5\ub370\uc774\ud2b8\ud558\uace0 \uc790\ub3d9 \ud0c0\uc785 \ucd94\ub860\uc744 \uc990\uae30\uc138\uc694:\\n\\n```bash\\ngem update t-ruby\\n```\\n\\n\uae30\uc874 \ucf54\ub4dc\ub294 \uc774\uc804\uacfc \ub3d9\uc77c\ud558\uac8c \ub3d9\uc791\ud569\ub2c8\ub2e4 - \uba85\uc2dc\uc801 \ud0c0\uc785\uc774 \uc5ec\uc804\ud788 \uc6b0\uc120\ub429\ub2c8\ub2e4. \ucd94\ub860\uc740 \ubc18\ud658 \ud0c0\uc785\uc774 \uc0dd\ub7b5\ub41c \uacbd\uc6b0\uc5d0\ub9cc \uc791\ub3d9\ud569\ub2c8\ub2e4.\\n\\n## \ud53c\ub4dc\ubc31\\n\\n\ud0c0\uc785 \ucd94\ub860 \uc0ac\uc6a9 \uacbd\ud5d8\uc744 \ub4e3\uace0 \uc2f6\uc2b5\ub2c8\ub2e4. \uc5e3\uc9c0 \ucf00\uc774\uc2a4\ub97c \ubc1c\uacac\ud558\uc168\ub098\uc694? \uc81c\uc548\uc774 \uc788\uc73c\uc2e0\uac00\uc694? [GitHub](https://github.com/aspect-build/t-ruby)\uc5d0\uc11c \uc774\uc288\ub97c \uc5f4\uc5b4\uc8fc\uc138\uc694.\\n\\n\uc990\uac70\uc6b4 \ud0c0\uc774\ud551 \ub418\uc138\uc694!"}]}}')}}]);